  false,\n\t\"url\": null,\n\t\"notes\": \"An ignition probability layer (fire density)
  was derived using an interpolation process (ArcInfo; pointinterp) of the fire start
  data. 2-km cells were used for the interpolation process because fire locations
  were commonly only reported to the nearest Public Land Survey Section (PLSS), approximately
  1 square mile. Interpolation resulted in 2-km cells being attributed with the count
  of ignitions. Ignition probability was derived by classifying the density data into
  5 classes (low to high) using the \"natural break\" algorithm included in ArcMap.
  The values represent relative values that have been standardized between 0.0 and
  1.0\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"responsible-party\",\n\t\t\"value\":
